(async () => {
  const sdkGenerator = new SdkGenerator({});


  const createAccountRequest: CreateAccountRequest = {	
    owner: "John Doe",
    currency: "COSMIC_COINS",
    balance: 1000,
    accountType: "STANDARD"
  };

  const { data } = await sdkGenerator.accounts.createAccount(createAccountRequest);

  console.log(data);
})();

